} Note: There are a lot of custom attributes you can add to fields. For example, to say you want to use this field for the argument after -o or --output, you'd add #[arg(short = 'o', long = "output")]. For more information, see the clap documentation . Right below the Cli struct our template contains its main function. When the program starts, it will call this function: fn main() { let args = Cli::parse(); println!("pattern: {:?}, path: {:?}", args.pattern, args.path)
} This will try to parse the arguments into our Cli struct. But what if that fails? That's the beauty of this approach: Clap knows which fields to expect and their expected format. It can automatically generate a nice --help message as well as give some great errors to suggest you pass --output when you wrote --putput. Note: The parse method is meant to be used in your main function. When it fails, it will print out an error or help message and immediately exit the program. Don't use it in other places!
